$(document).ready(function () {
      $(".menu-icon").on("click", function () {
            $("nav ul").toggleClass("showing");
      });
});

// Scrolling Effect

$(window).on("scroll", function () {
      if ($(window).scrollTop()) {
            $('nav').addClass('black');
      }

    else {
          $('nav').removeClass('black');
    }
});

$(window).resize(function(){
      resizePhone();
      if($( window ).width() < 993){
            $('.li-sub').remove();  
      }
      changeSliderToMobile();
      changeSvg();
      moveTextAboveSVG();

});

$(document).ready(function(){
      resizePhone();
      changeSliderToMobile();
      changeSvg();
      moveTextAboveSVG();
        //Adicionar submenu em dispositivos móveis
      var sectorsbtn = document. getElementById("sectors-btn");
      sectorsbtn.onclick = function(event) {
            if($( window ).width() < 993){
            if ($(".li-sub").length > 0){
                  $('.li-sub').remove();
            }
            else{
                  $("#list-menu li:eq(0)").after('<li class="li-sub" style= "padding: 0px"><a class="dropbtn-sub">TI</a></li>');
                  $("#list-menu li:eq(0)").after('<li class="li-sub" style= "padding: 0px"><a class="dropbtn-sub">Indústria</a></li>');
                  $("#list-menu li:eq(0)").after('<li class="li-sub" style= "padding: 0px"><a class="dropbtn-sub">Distribuição</a></li>');
                  $("#list-menu li:eq(0)").after('<li class="li-sub" style= "padding: 0px"><a class="dropbtn-sub">Construção</a></li>');
            }
            }
      }
});

function resizePhone(){
      if($(window).width() < 500)
      {
          $("#items_to_move").insertAfter("#support_div");
      }else if($(window).width() < 992){
            $("#items_to_move").insertAfter("#support_div");
      }else{
            $("#items_to_move").insertAfter("#anturio_logo");
      }
  }

